import profilePicture from './images/profile-picture.jpeg'
import email from './images/envelope-icon.png';

export default function NavBar() {
  return (
    <header>
        <div className='avatar'>
        <img src={ profilePicture } alt='My Profile Avatar' className='profile'></img>
        </div>
        <h3>Le Roy Powell Louis</h3>
        <div className='buttons'>
            <button className='email'>
            <img src={ email } alt='email icon' className='email-icon'></img><p>Email</p></button>
            <button className='contact'><p>Contact</p></button>
        </div>
    </header>
  );
};
